import logo from './logo.svg';
import './App.css';
import { Unity, useUnityContext } from "react-unity-webgl";

function App() {
  const { unityProvider } = useUnityContext({
    loaderUrl: "build/BirdGangGame.loader.js",
    dataUrl: "build/BirdGangGame.data",
    frameworkUrl: "build/BirdGangGame.framework.js",
    codeUrl: "build/BirdGangGame.wasm",
  });

  return <Unity unityProvider={unityProvider} />;
}

export default App;
